export const editProfileIdReducer = (state = [], action) => {
  switch (action.type) {
    case "GET_ALL_DATA_PROFILID_REQUEST":
      return {
        ...state,
        loading: true,
      };
    case "GET_ALL_DATA_PROFILID_SUCCESS":
      return {
        ...state,
        loading: false,
        data: action.payload,
      };
    case "GET_ALL_DATA_PROFILID_FAIL":
      return {
        ...state,
        loading: false,
        data: [],
        error: action.payload,
      };

    default:
      return {
        state,
      };
  }
};
